import React from 'react';
import { useSelector } from 'react-redux';
import styled from 'styled-components';
import { selectUserHoursWorking } from '../userInputForm/userInputSlice';

const BudgetReturnDiv = styled.div`
  display: flex;
  width: 1000px;
  margin-left: 10px;
`;

const BudgetMessageDiv = styled.div`
  color: white;
  margin-left: 10px;
`;

const ValueDiv = styled.div`
  color: red
`;

function BudgetTile(props) {
  return (
    <div>
      <BudgetReturnDiv>
        <ValueDiv>
          {props.monthlyIncome * 0.6}
        </ValueDiv>
        <BudgetMessageDiv>is 60% of your monthly income for living expenses</BudgetMessageDiv>
      </BudgetReturnDiv>
    </div>
  );
}

export default BudgetTile;
